import 'reflect-metadata';
import { Network, Node, QuorumSet } from '@stellarbeat/js-stellarbeat-shared';
import FbasAnalyzerService, { AnalysisResult } from '../FbasAnalyzerService';
import FbasAnalyzerFacade from '../FbasAnalyzerFacade';
import { LoggerMock } from '../../../../core/services/__mocks__/LoggerMock';

describe('analyze fbas', () => {
	it('should not have a symmetric top tier', function () {
		const fbasAnalyzerService = new FbasAnalyzerService(
			new FbasAnalyzerFacade(),
			new LoggerMock()
		);
		const nodes = getNodes();
		nodes.forEach((node: Node) => {
			if (
				node.publicKey ===
				'GCGB2S2KGYARPVIA37HYZXVRM2YZUEXA6S33ZU5BUDC6THSB62LZSTYH'
			) {
				//modify sdf
				const innerQSet = node.quorumSet.innerQuorumSets.pop();
				if (innerQSet)
					innerQSet.validators = [
						'GCGB2S2KGYARPVIA37HYZXVRM2YZUEXA6S33ZU5BUDC6THSB62LZSTYH'
					];
			}
		});

		const result = fbasAnalyzerService.performAnalysis(new Network(nodes));
		expect(result.isOk()).toBeTruthy();
		if (result.isOk()) {
			expect(result.value.hasSymmetricTopTier).toBeFalsy();
		}
	});

	it('should analyze correctly', () => {
		const fbasAnalyzerService = new FbasAnalyzerService(
			new FbasAnalyzerFacade(),
			new LoggerMock()
		);
		const result = fbasAnalyzerService.performAnalysis(
			new Network(getNodes(), getOrgs())
		);
		expect(result.isOk()).toBeTruthy();
		if (result.isOk()) {
			const analysisResult: AnalysisResult = result.value;
			expect(analysisResult.hasSymmetricTopTier).toBeTruthy();
			expect(analysisResult.node.topTierSize).toEqual(23);
			expect(analysisResult.organization.topTierSize).toEqual(7);
			expect(analysisResult.node.blockingSetsMinSize).toEqual(6);
			expect(analysisResult.node.blockingSetsFilteredMinSize).toEqual(6);
			expect(analysisResult.node.splittingSetsMinSize).toEqual(3);
			expect(analysisResult.organization.splittingSetsMinSize).toEqual(3);
			expect(analysisResult.country.splittingSetsMinSize).toEqual(1);
			expect(analysisResult.isp.splittingSetsMinSize).toEqual(1);
			expect(analysisResult.hasQuorumIntersection).toBeTruthy();
		}
	});

	it('should filter out badly configured nodes', () => {
		const fbasAnalyzerService = new FbasAnalyzerService(
			new FbasAnalyzerFacade(),
			new LoggerMock()
		);
		const correctNode = new Node('A');
		correctNode.quorumSet.validators.push('A', 'B');
		expect(
			fbasAnalyzerService.isNodeCorrectlyConfigured(correctNode)
		).toBeTruthy();
		const correctNode2 = new Node('A');
		correctNode2.quorumSet.validators.push('A');
		correctNode2.quorumSet.innerQuorumSets.push(new QuorumSet());
		expect(
			fbasAnalyzerService.isNodeCorrectlyConfigured(correctNode2)
		).toBeTruthy();
		const inCorrectNode = new Node('A');
		inCorrectNode.quorumSet.validators.push('A');
		expect(
			fbasAnalyzerService.isNodeCorrectlyConfigured(inCorrectNode)
		).toBeFalsy();
	});

	it('should filter out edge nodes', () => {
		const fbasAnalyzerService = new FbasAnalyzerService(
			new FbasAnalyzerFacade(),
			new LoggerMock()
		);
		const rawNodes = getNodesWithQIViolatingEdgeNode();
		const network = new Network(rawNodes.map((raw) => Node.fromJSON(raw)));
		const result = fbasAnalyzerService.performAnalysis(network);
		expect(result.isOk());
		if (result.isOk()) {
			expect(result.value.hasQuorumIntersection).toBeTruthy();
		}
	});
});

